import React from 'react';

import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    title: [],
    desc: []
  }

  componentDidMount() {
    axios.get(`https://api.github.com/users/mikifriki/repos`)
      .then(rest => {
        const title = rest.data;
        this.setState({ title });
      })

  }

  render() {
    return (
      <ul>
        { this.state.title.map(title => <li>{title.name}</li>)}
      </ul>
    )
  }
}
